import { Fragment } from 'react';
import FavoriteBorderIcon from '@mui/icons-material/FavoriteBorder';
import NotificationsNoneIcon from '@mui/icons-material/NotificationsNone';
import MailOutlineIcon from '@mui/icons-material/MailOutline';
import AppsIcon from '@mui/icons-material/Apps';
import SearchIcon from '@mui/icons-material/Search';
import classes from '../components/Header.module.css';
import iconImage from '../components/images/icon.jpg';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';



function Header () {
  return(
  <Fragment>
   <div className={classes.Header}>
    <div className={classes.img}>
        <img src={iconImage} alt="social media icon" />
    </div> 
    <div className={classes.icon1}><FavoriteBorderIcon /></div>
    <div className={classes.icon}><NotificationsNoneIcon /></div>
    <div className={classes.icon}><MailOutlineIcon /></div>
    <div className={classes.icon}><AppsIcon /></div>

    <div className={classes.items}>
    <div className={classes.search}>
     <SearchIcon /> <input type="text" placeholder="Search" className={classes.formcontrol} /></div>
    <div className={classes.cart}><ShoppingCartIcon /></div>
    </div>
    </div>
    <hr className={classes.line}/>

 </Fragment>
  );
}

export default Header;
